import React, { Component } from "react";

class App extends Component{
  render() {
    const { invoice } = this.props;

    return <div className='App'>
      <h1>{invoice.status()}</h1>
      <button onClick={invoice.markPaid}>pay</button>
    </div>;
  }
}

export default App;
